import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold mb-4">Cafe Dashboard</h2>
      <ul className="space-y-2">
        <li><Link to="/add-customer" className="text-blue-600 hover:underline">Add Customer</Link></li>
        <li><Link to="/add-transaction" className="text-blue-600 hover:underline">Add Transaction</Link></li>
        <li><Link to="/stats" className="text-blue-600 hover:underline">View Stats</Link></li>
      </ul>
    </div>
  );
};

export default Dashboard;
